  [],\n\t\"num_tags\": 0,\n\t\"name\": \"ocean-margin-exchange-ii-database-from-the-upwelling-region-of-the-narrow-iberian-margin-from-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Ocean Margin EXchange (OMEX) II aims at
  studying, measuring and modeling the processes and fluxes occurring along and across
  the European shelf break facing the North Atlantic Ocean. It serves as the basis
  for the development of predictive models of the global environmental change. The
  second phase of OMEX II concentrates on the upwelling region of the narrow Iberian
  margin. Findings are divided into 5 work packages. Work package I, temporal evolution
  of surface production and fate of organic matter. Work package II, spatial and seasonal
  fluxes and biogeochemical process in the water column. Work package III, Fluxes
  and processes in the nepheloid layers and surface sediments. Work package IV, Integrated
  margin-exchange product. Work package V, project management and coordination.\",\n\t\"owner_org\":
